**Method 1 (Using PHP's `strtr()` function) :**

Here is how to implement it:

```php
function fn($record)
{
    $employeeRecord = Employee::select(['fname','name','mname'])->where('id',$record->id)->first()->toArray();

    return strtr(json_encode($employeeRecord), ',','');
}
